import "../css/header.css";

const HeaderButtom = () => {
  return (
    <div>
     <section id="hero" class="d-flex align-items-center">
          <div class="container">
            <div class="row">
                <div class="col-lg-6 d-flex flex-column justify-content-center pt-4 pt-lg-0 order-2 order-lg-1" data-aos="fade-up" data-aos-delay="200">
                  <h1 className='text-dark'>คอนเวเยอร์</h1>
                  <p className='text-dark'>ผู้ผลิต จำหน่าย และนำเข้า เครื่องจักรอุปกรณ์และนวัตกรรมด้านการขนส่งลำเลียง ระบบจัดเก็บสินค้า ระบบชั้นวางสินค้าอุตสาหกรรม และงานโลจิสติกส์ สร้างไลน์การผลิต (Production Line) ไลน์คอนเวเยอร์ (Conveyor line) โดยมืออาชีพ อย่างครบวงจรตั้งแต่เริ่มต้นจนเสร็จสิ้น</p>
                 
                  <div class="d-flex justify-content-center justify-content-lg-start"> 
                    <a href="#about" style={{background: "#8443a9"}} class="btn-get-started scrollto me-2">Get Started</a>
                    <a href="#about" style={{background: "rgb(0, 0, 0)"}} class="btn-get-started scrollto">Office Automation</a>
                    </div>
                  </div>

                <div class="col-lg-6 order-1 order-lg-2 hero-img" data-aos="zoom-in" data-aos-delay="200"> <img src="assets/img/hero-img.png" class="img-fluid animated" alt="" /></div>
            </div>
          </div>
        </section>
    </div>
  );
};

export default HeaderButtom;
